import React, { useEffect, useState } from 'react';
import axios from 'axios';

const UserTable = () => {
  const [users, setUsers] = useState([
    { id: 1, first: '', last: '', handle: '' },
    { id: 2, first: '', last: '', handle: '' },
    { id: 3, first: '', last: '', handle: '' },
  ]);

  useEffect(() => {
    // Uncomment and update the URL once the backend is ready
    // axios.get('http://external-backend-url/api/users')
    //   .then(response => {
    //     setUsers(response.data);
    //   })
    //   .catch(error => {
    //     console.error('There was an error fetching the user data!', error);
    //   });
  }, []);

  return (
    <table className="table">
      <caption>List of users</caption>
      <thead>
        <tr>
          <th scope="col">#</th>
          <th scope="col">First</th>
          <th scope="col">Last</th>
          <th scope="col">Handle</th>
        </tr>
      </thead>
      <tbody>
        {users.map(user => (
          <tr key={user.id}>
            <th scope="row">{user.id}</th>
            <td>{user.first}</td>
            <td>{user.last}</td>
            <td>{user.handle}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default UserTable;
